    public function getSourceContext()
    {
        return new Source("{% extends 'base.html.twig' %}

{% block title %}Log in!{% endblock %}

{% block body %}
  <div class=\"row\">
    <div class=\"col-12\">
      <form method=\"post\">
        {% if error %}
          <div class=\"alert alert-danger\">{{ error.messageKey|trans(error.messageData, 'security') }}</div>
        {% endif %}

        <h1 class=\"h3 mb-3 font-weight-normal\">Zaloguj się</h1>

        <div class=\"form-group\">
          <label for=\"inputUsername\">Login</label>
          <input type=\"text\" value=\"{{ last_username }}\" name=\"username\"
                 id=\"inputUsername\" class=\"form-control\" placeholder=\"Login\"
                 required autofocus>
        </div>

        <div class=\"form-group\">
          <label for=\"inputPassword\">Hasło</label>
          <input type=\"password\" name=\"password\" id=\"inputPassword\"
                 class=\"form-control\" placeholder=\"Hasło\" required>
        </div>

        <input type=\"hidden\" name=\"_csrf_token\"
               value=\"{{ csrf_token('authenticate') }}\">

        <button class=\"btn btn-lg btn-primary\" type=\"submit\">
          Zaloguj
        </button>
      </form>
    </div>
  </div>
{% endblock %}
", "security/login.html.twig", "/opt/lampp/htdocs/rekrutacja/templates/security/login.html.twig");
